import React from 'react'
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import './navBarStyle.css'
import {useNavigate} from "react-router-dom"
function NavBar({ title }) {
     console.log("The location", window.location.href.split('/')[3])
    const navigate= useNavigate();

     return (
          <Navbar expand="lg" variant="light" bg="light">
               <Container>
                    <Navbar.Brand href="#">
                    {
                         window.location.href.split('/')[3] === "newAuction" ?
                         <>
                              <div>
                              <button type="button" class="btn btn-secondary" data-dismiss="modal" onClick={() => navigate(-1)}>Back</button>
                                   

                              </div>
                         </>
                         :
                         <>
                         Hi Danial
                         </>


                    }
                    <b>{title}</b> 

                    </Navbar.Brand>


                    {window.location.href.split('/')[3] === "home" &&
                         <button type="button" className="btn btn-danger">Log out</button>
                    }
                    {
                         window.location.href.split('/')[3] === "newAuction" &&
                         <>
                              <div>
                                   <button type="button" className="btn btn-primary home_button">Home</button>
                                   <button type="button" className="btn btn-danger">Log out</button>

                              </div>
                         </>


                    }

               </Container>
          </Navbar>
     );
}

export default NavBar;
